import { useNavigate, useParams } from 'react-router-dom';
import { useCookies } from 'react-cookie';
import React, { useState, useEffect } from 'react';
import classes from './Bookcover.module.css';
import axios from 'axios';

const MaterialPage = () => {
    const [Questions, setQuestions] = useState([]);
    const [isLoading, setIsLoading] = useState(false);
    const [error, setError] = useState('');
    const { materialName } = useParams();
    const [cookie] = useCookies('__material_id');

    const materialId = cookie.__material_id;
    // `https://app.prepanywhere.com/api/stu/static_books/question_details?id=051fb175-ed70-4e5d-96c0-9ba453b5377a`

    useEffect(() => {
        const getQuestions = async () => {
            try {
                axios
                    .get(
                        `https://app.prepanywhere.com/api/stu/static_books/question_details?id=051fb175-ed70-4e5d-96c0-9ba453b5377a`
                    )
                    .then((response) => {
                        setQuestions(response.data);
                        // console.log(Book.chapters)
                        console.log(response.data);
                    });
            } catch (err) {
                console.log('error while getting questions', err);
            }
        };

        getQuestions();
    }, [materialId]);

    return (
        <div className={classes.section}>
            <div className={classes.header}>
                <h1>{materialName.replace(/-/g, ' ')}</h1>
                {/* <h1> Chapter Name </h1> */}
            </div>
            <div className={classes.container}>
                <div>
                    <ul>
                        {/* {Questions?.map((question) => {
                            return (
                                <div>
                                    <li> {question.uuid} </li>
                                </div>
                            );
                        })} */}
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default MaterialPage;
